import { Nav, Navbar, Container } from 'react-bootstrap';

function Navi () {
    return (
        <Navbar bg="dark" variant="dark" >
            <Container>
            <Nav className="me-auto">
                <Nav.Item>
                    <Nav.Link href="/home">Home</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link href="/order">Orders</Nav.Link>
                </Nav.Item>
            </Nav>
            </Container>
        </Navbar>
        
    );
}

export default Navi;
